import { useContext } from 'react';

import classes from './Actions.module.css';

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

import FavoritesContext from '../../store/favorites-context';

function Actions(props) {

    const favoritesCtx = useContext(FavoritesContext);

    function toggleFavoriteStatusHandler(){
        console.log(props);
    }

    return(
        <div className={classes.actions}>
            <button onClick={props.openArt} className={classes.btn}><FontAwesomeIcon icon={["fas", "search-plus"]} size="3x"/></button>
            <button onClick={toggleFavoriteStatusHandler} className={classes.btn}><FontAwesomeIcon icon={["far", "star"]} size="3x"/></button>
        </div>
    );
}

export default Actions;
